import react,{Fragment, useState, useEffect} from 'react'
import './syles/home.css'
import { Col } from 'react-bootstrap'
import Carousel from 'react-bootstrap/Carousel';
import ExampleCarouselImage from 'components/ExampleCarouselImage';



function Home() {
    const [data, setData]= useState([])
    const fetchUserData = ()=>{
        fetch('https://fakestoreapi.com/products').then(
        response => {return response.json()}
    ).then(data => {
        setData(data)
    })
    const myObj = {name: "John", age: 31, city: "New York"};
    const myJSON = JSON.stringify(myObj);
    localStorage.setItem("testJSON", myJSON);
    let text = localStorage.getItem("testJSON");
    let obj = JSON.parse(text);
    console.log(obj);

    }
    useEffect(() => {
        fetchUserData();
    }, [])
    return (
        <div className='container'>
            <Carousel fade>
      <Carousel.Item>
        <ExampleCarouselImage text="First slide" />
        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <ExampleCarouselImage text="Second slide" />
        <Carousel.Caption>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <ExampleCarouselImage text="Third slide" />
        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
            
        <div className='row gy-2 pt-3'>
        {
            data.map(
            (product)=>{
                return(
                        <Col sm={6} md={4} lg={3} className=''>
                            <div className='   product rounded p-3'>
                                <img className='border p-2  img-fluid ' src={product.image} alt='' />
                                <p className='price' >{product.price}$</p>
                                <p>{product.title}</p>
                                <div className='w-100 h-100 description p-2 d-flex flex-column justify-content-between '>
                                    <p className='p-3'>{product.description}</p>
                                    <button className='btn bg-light'>Add To Cart</button>
                                </div>
                                
                            </div>
                        </Col>

                )
            }
            )
        }
        </div>
        </div>
    )
    }

export default Home
